                        <html><head><meta charset="utf-8"></head><body>
<p>Unitabs Prebiotic &mdash; это пребиотик для собак и кошек, который содержит коэнзим Q10 и все необходимые компоненты для нормализации пищеварения и укрепления иммунитета.</p>
<p>Unitabs Prebiotic:</p>
<p>восстанавливает полезную микрофлору кишечника<br />улучшает всасывание питательных веществ<br />укрепляет иммунитет<br />Давайте Unitabs Prebiotic животным:</p>
<p>при нарушениях пищеварения: диарее, вздутии, метеоризме<br />во время приема антибиотиков<br />при плохом усвоении корма<br />В состав Unitabs Prebiotic входят:</p>
<p>инулин стимулирует рост полезной микрофлоры кишечника, нормализует пищеварение;</p>
<p>пектин улучшает перистальтику, освобождает кишечник от различных токсикантов.</p>
</body></html>

                    </div>
                
            
                


                

                    <div class="tab-pane  "  id = "tab5">


                        <html><head><meta charset="utf-8"></head><body>
<div><strong>I. Общие сведения</strong></div>
<div>1. Юнитабс Пребиотик (Unitabs Рrebiotic) &ndash; кормовая добавка для оптимизации процессов пищеварения у кошек и собак.</div>
<div>2. В состав Юнитабс Пребиотика входят: сухое обезжиренное молоко &ndash; 39,5-48,3 %, отруби пшеничные &ndash; 18,0-22,0 %, инулин &ndash; 17,0-19,0 %, кальция гидрофосфат дигидрат &ndash; 9,0-11,0 %, желатин &ndash; 2,7-3,3 %, пектин - 2,0-3,0 %, лактоза &ndash; 0,9-1,1 %, аэросил А - 0,9-1,1 %, стеарат кальция - 0,45-0,55 %, коэнзим Q10 - 0,09-0,11 %, краситель &laquo;коричневый шоколад&raquo; - 0,0014-0,0017 %.</div>
<div>Не содержит генно-инженерно-модифицированных продуктов.</div>
<div>3. По внешнему виду представляет собой таблетки цилиндрической формы, двояковыпуклые, от светло-коричневого до темно-коричневого цвета с вкрап-лениями.</div>
<div>4. Выпускают в форме таблеток массой 0,75 г, расфасованных по 100 штук в полимерные банки с навинчиваемой крышкой.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Каждую единицу фасовки маркируют с указанием: наименования организации-производителя, ее товарного знака и адреса, названия кормовой добавки, её назначения, способа применения, массы таблетки и количества таблеток в упаковке, состава и гарантируемых показателей, номера партии, даты изготовления, срока и условий хранения, информации о подтверждении соответствия, обозначения СТО, регистрационного номера, надписи &laquo;Для животных&raquo; и снабжают инструкцией по применению.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Хранят в закрытой упаковке производителя, в защищенном от прямых солнечных лучей месте при температуре от 0 0С до 25 0С.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Срок хранения - 24 месяца со дня изготовления.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Запрещается использовать по истечении срока хранения.</div>
<div>&nbsp;</div>
<div><strong>II. Биологические свойства</strong></div>
<div>5. Биологические свойства Юнитабс Пребиотика обусловлены входящими в состав биологически активными веществами, которые создают в кишечнике благоприятные условия для развития нормальной микрофлоры, способствующей оптимизации пищеварения, улучшению усвояемости и переваримости корма, а также повышению иммунитета животных.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Инулин стимулирует рост и метаболическую активность бифидо- и лактобакте-рий, тем самым поддерживая их нормальную популяцию в кишечнике кошек и собак.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Сухое обезжиренное молоко является естественным источником витаминов А и группы В, минеральных веществ (Ca, P, K, Mg, Na), незаменимых аминокислот, необходимых для нормальной жизнедеятельности организма.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Пшеничные отруби являются источником пищевых волокон и клетчатки, которые в сочетании с пектином мягко воздействуют на пищеварительную систему, улучшают перистальтику, освобождая кишечник от различных токсикантов.</div>
<div>&nbsp;&nbsp;&nbsp;&nbsp; Коэнзим Q10 - катализатор процессов метаболизма, антиоксидант, способствует укреплению иммунной системы, защите здоровья десен и зубов.</div>
<div>&nbsp;</div>
<div><strong>III. Порядок применения</strong></div>
<div>6. Кормовая добавка Юнитабс Пребиотик предназначена для оптимизации процессов пищеварения у кошек и собак.</div>
<div>7. Побочных явлений и осложнений при применении Юнитабс Пребиотика в соответствии с инструкцией&nbsp; по применению не выявлено. В случае проявления аллергических реакций прием добавки необходимо прекратить.</div>
<div>8. Не применять совместно с препаратами и кормовыми добавками, содержащими инулин, пектин.</div>
<div>9. Добавка противопоказана при индивидуальной непереносимости компонентов.</div>
<div>&nbsp;</div>
<div><strong>IV. Меры личной профилактики</strong></div>
<div>10. При работе с Юнитабс Пребиотиком следует соблюдать общие правила личной гигиены и техники безопасности, предусмотренные при работе с кормовыми добавками.</div>
<div>11. Хранить в местах, недоступных для детей.</div>
<div>&nbsp;</div>
